import { faBars, faBell, faUser } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { useRouter } from "next/router";
import { Box_header, Box_logo, Container, Logo, Menu_isMobile, Menu_isDesktop } from "./styled";

const Header = () => {
    const router = useRouter()
    return (
        <>
            <Container>
                <Box_header>
                    <Box_logo>
                        <Logo src="/static/img/block.png" />
                        <a>BLOCKCHAIN</a>
                    </Box_logo>
                    <Menu_isDesktop>
                        <ul>
                            <li className={`${router.pathname === "/Home/main" ? "pathname" : " "}`}>Wallet</li>
                            <li className={`${router.pathname === "/Home/main" ? "pathname" : " "}`}>News</li>
                            <li className={`${router.pathname === "/Home/main" ? "pathname" : " "}`}>About</li>
                            <li className={`${router.pathname === "/Home/main" ? "pathname" : " "}`}>Terms</li>
                        </ul>
                    </Menu_isDesktop>
                    <Menu_isMobile>
                        <button><FontAwesomeIcon icon={faBell} /></button>
                        <button><FontAwesomeIcon icon={faUser} /></button>
                        <button><FontAwesomeIcon icon={faBars} /></button>
                    </Menu_isMobile>
                </Box_header>
            </Container>
        </>
    )
}

export default Header;
